import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styles from './SuperAdminDashboard.module.css';

const SuperAdminDashboard = () => {
  const [summary, setSummary] = useState(null);
  const [delayedRequests, setDelayedRequests] = useState([]);
  const [showDelayed, setShowDelayed] = useState(false);
  const [residentCount, setResidentCount] = useState(null);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      const summaryResponse = await axios.get('/api/dashboard/summary');
      const residentsResponse = await axios.get('/api/users/count');
      setSummary(summaryResponse.data);
      setResidentCount(residentsResponse.data.count);
    } catch (err) {
      setError('Failed to load dashboard data.');
    }
  };

  const handleViewReports = () => {
    setShowDelayed(false);
  };

  const handleViewDelayedRequests = async () => {
    try {
      const response = await axios.get('/api/requests/delayed');
      setDelayedRequests(response.data);
      setShowDelayed(true);
    } catch (err) {
      setError('Failed to load delayed requests.');
    }
  };

  return (
    <div className={styles.dashboardContainer}>
      <h1>Super Admin Dashboard</h1>

      {error && <p className={styles.error}>{error}</p>}

      <div className={styles.cardContainer}>
        <div className={styles.card}>
          <h2>Residents</h2>
          <p>{residentCount !== null ? residentCount : 'Loading...'}</p>
        </div>

        <div className={styles.card}>
          <h2>Total Requests</h2>
          <p>{summary ? summary.total : 'Loading...'}</p>
        </div>

        <div className={styles.card}>
          <h2>Completed</h2>
          <p>{summary ? summary.completed : 'Loading...'}</p>
        </div>

        <div className={styles.card}>
          <h2>Pending</h2>
          <p>{summary ? summary.pending : 'Loading...'}</p>
        </div>

        <div className={styles.card}>
          <h2>Delayed</h2>
          <p>{summary ? summary.delayed : 'Loading...'}</p>
        </div>
      </div>

      <div className={styles.buttonGroup}>
        <button onClick={handleViewReports}>View Reports</button>
        <button onClick={handleViewDelayedRequests}>View Delayed Requests</button>
      </div>

      {showDelayed && (
        <div className={styles.tableContainer}>
          <h2>Delayed Requests</h2>
          {delayedRequests.length > 0 ? (
            <table className={styles.table}>
              <thead>
                <tr>
                  <th>Request ID</th>
                  <th>User ID</th>
                  <th>Description</th>
                  <th>Status</th>
                  <th>Expected Completion</th>
                </tr>
              </thead>
              <tbody>
                {delayedRequests.map((request) => (
                  <tr key={request.requestId}>
                    <td>{request.requestId}</td>
                    <td>{request.userId}</td>
                    <td>{request.description}</td>
                    <td>{request.status}</td>
                    <td>{request.exceptCompletion}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          ) : (
            <p>No delayed requests found.</p>
          )}
        </div>
      )}
    </div>
  );
};

export default SuperAdminDashboard;
